"use strict";$(document).ready(function(){var b=$('[data-action="subscribe"]');var a=$('form[name="subscribe"]');b.on("click",function(){a.submit()});a.submit(function(d){d.preventDefault();var c=a.serialize();$.ajax({url:"",type:"POST",data:c,processData:false,cache:false,dataType:"json",success:function(e){if(e.status=="success"){$("p.error").html('<img src="images/gif-load.gif" style="width: 25px;"/>');$("p.error").html(e.message);$("p.error").parent().show();location.reload()}if(e.status=="error"){$("p.error").html(e.message);$("p.error").parent().show()}}})})});